import ServiceItem from "./ServiceItem";

function ServicesList(props){
    return(
        <ul>
            {props.services.map((service) => <ServiceItem
            title={service.title}
            list={service.list}
            />)
            }
        </ul>
    );
}

export default ServicesList;
